    private static Neiron NeironCreate(Dictionary<String, Object> O)
    {
        Neiron res = new Neiron();
        res.name = (String)O.get("name");
        res.countTrainig = (int)O.get("countTrainig");
        Object[] veightData = (Object[])O.get("veight");
        int arrSize = (int)Math.sqrt(veightData.length);
        res.veight = new double[arrSize][arrSize];
        int index = 0;
        for (int n = 0; n < res.veight.length; n++)
            for (int m = 0; m < res.veight[0].length; m++)
            {
                res.veight[n][m] = (double)veightData[index];
                index++;
            }
        return res;
    }
